import React from 'react';
import { Redirect } from 'react-router-dom';

const Resident = () => {
	if (true) {
		return (
			<div>
				<Redirect to="/newResident" />
			</div>

		);
	} else {
		return (
			<div>
				<p>Resident</p>
			</div>

		);
	}
}

export default Resident;
